import React from 'react';
import './index.css';

function App() {
  return (
    <div className="grid grid-cols-1 gap-4 m-5 justify-center">
      <div>
        <h1 className="text-3xl font-bold font-sans">My Tasks</h1>
      </div>
      <div className="form-check flex flex-row items-center">
        <input type="checkbox" class="h-3 w-3 rounded-full" />
        <p class="ml-3 text-xl">Add task</p>
      </div>
    </div>
  );
}

export default App;
